import React from 'react';
import Link from 'next/link';

import TextLabel from '../UI/TextLabel/TextLabel';
import FilmsList from '../FilmsList/FilmsList';

import * as S from './PlanetStyles';
import * as GS from '../../pages/globalStyles';

const Planet = ({ Name, Climate, Population, Films }) => {
  return (
    <GS.Main>
      <GS.Wrap>

        <Link href="/" passHref>
          <a>Back</a>
        </Link>

        <S.Planet>
          <S.Name>{Name}</S.Name>
          <S.Info>
            <TextLabel label="Climate" text={Climate} />
          </S.Info>
          <S.Info>
            <TextLabel label="Population" text={Population} />
          </S.Info>
        </S.Planet>
      </GS.Wrap>

      <GS.Wrap>
        <FilmsList films={Films} />
      </GS.Wrap>
    </GS.Main>
  );
};

export default Planet;
